<style>
/*買い物カゴボタン*/
#rakutenLimitedId_aroundCart input {
  width: 260px;
  height: 60px;
  background:url(http://image.rakuten.co.jp/interior-takanishiki/cabinet/navi2/cad.gif) #fcfcfc no-repeat;
  overflow: hidden;
  border-width: 0px;
  cursor: pointer !important;
  text-indent: 150%;
  white-space: nowrap;
  margin: 5px 0 0 0;}

/*個数入力*/
#rakutenLimitedId_aroundCart input#units {
  border:solid #ccc 1px;
  background:#fff!important;
  width:30px;
  height:30px;
  cursor:auto;
  padding:7px 7px 7px 3px;
  text-indent: 0px;
  overflow: hidden;}

/*お問い合わせボタン*/
#rakutenLimitedId_aroundCart font input {
  width: 260px;
  height: 60px;
  background:url(http://image.rakuten.co.jp/interior-takanishiki/cabinet/navi2/mail.gif) #fcfcfc no-repeat;
  overflow: hidden;
  border-width: 0px;
  cursor: pointer;
  display: block;}

#rakutenLimitedId_aroundCart #serviceTableSml td.favorite {
width: 300px !important;
}
</style>
